                await ExportReportdriAsPdf($"{nameof(HassyaAllrightCloud.Reports.ReportFactory.ReportJomukirokubo)}?" + reportData.Uri);
            }
            else
            {
                await ExportBaseReportAsPdf();
            }
        }
        else
        {
            PopupCheckData = true;
        }
    }

